export const enum IS_LIMIT {
  NO_LIMIT = 0, // 不限次
  LIMIT = 1 // 限次
}

export const enum PACKAGE_TYPE {
  ALL_COURSE = 1, // "不限课程"
  RANGE_COURSE = 2, // "范围内课程"
  FIXED_COURSE = 3 // "固定课程"
}
